import React from 'react'


const TestCard = ({ testsData }) => {
  //  console.log(testsData);
  return (
    <>
      <section className='main-card--cointainer1'>
        {testsData.map((curElem) => {
          const { Level,
            Image,
            testName,
            Description,
            testLink,
            testDuration,
            NoOfQuestions,
            totalMarks } = curElem;
          return (
            <>

              <div className="Product-card-Top">
                <div className="Product-card"  >


                  <div className="card-body" style={{height:"70%"}}>
                    <h5 class="card-title">{testName}</h5>
                    <p class="card-text">LEVEL : {Level}</p>
                    <p class="card-text">DESCRIPTION : {Description}</p>
                    <p class="card-text">TEST DURATION : {testDuration}</p>
                    <p class="card-text">NO OF QUESTIONS : {NoOfQuestions}</p>
                    <p class="card-text">TOTAL MARKS : {totalMarks}</p>

                    <div >
                      <a className="card-link" href={testLink} target="_blank">
                        <button type="button" class="btn " style={{ width: "95%", backgroundColor: "#4dbf1c", color: "black" , marginLeft:"2%" }}>GO TO TEST</button>
                      </a>

                    </div>
                  </div>
                </div>
              </div>



            </>
          )
        })}
      </section>
    </>

  )
}
export default TestCard
